import React from "react";
import Slider from "react-slick";
import "./index.css";

class simpleSlider extends React.Component {
  render() {
    var settings = {
      dots: true
    };
    return (
      <div className="container">
        <Slider {...settings}>
          <div>
            1
          </div>
          <div>
            2
          </div>
          <div>
            3
          </div>
          <div>
            4
          </div>
        </Slider>
      </div>
    );
  }
}

export default simpleSlider;
